/* example component. follow this template */

import React, { Component } from 'react';
import 'materialize-css/dist/css/materialize.min.css';

class Example extends Component {
    render() {
        return(
            <div>
                <p>This is an example</p>
            </div>
        );
    }
}

export default Example;
